import React, { useEffect,useState } from 'react';
import './App.css';

const App = () => {
 const url = "/users";
 const [users, setUsers] = useState([])

 useEffect(() => {
   fetch(url, { method: "GET" })
     .then((res) => res.json())
     .then((data) => {
       setUsers(data);
     })
     .catch((err) => {
       console.log(err);
       console.log("err");
     });
 }, []);

    return (
      <div classname="App">
        <h1>Users</h1>
        {users[0]}
      </div>
    );
}

export default App;
